import React from "react";
import ExpenseItem from "./ExpenseItem";
import "./ExpenseList.css";

if (props.items.length > 0) {
  let expenseContent = props.items.map((expense) => (
    <ExpenseItem
      key={expense.id}
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />
  ));
}

export default expenseContent;
